import React, {Component} from 'react';

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = {
      repos: [],
      isLoaded: false,
      error: null
    };
  }

  getRepos = () => {
    fetch('https://api.github.com/users/calebdsharp/repos')
    .then(
      (result) => {
      this.setState({
        isLoaded: true,
        items: result
      });
    })
  }

  render() {
    return(
      <>Projects</>
    );
  }
}

export default Projects;
